-- hango 데이터 베이스 생성
CREATE DATABASE IF NOT EXISTS hango;

-- hango 데이터 베이스 사용
USE hango;

-- 유저 테이블 생성
CREATE TABLE `users` (
  `user_id` varchar(30) NOT NULL,
  `user_name` varchar(30) NOT NULL,
  `user_email` varchar(60) NOT NULL,
  `user_passwd` varchar(128) NOT NULL,
  `user_in_date` datetime DEFAULT CURRENT_TIMESTAMP,
  `user_salt` varchar(128) NOT NULL,
  PRIMARY KEY (`user_id`)
);

-- 자판기 테이블 생성
CREATE TABLE `vendings` (
  `serial_number` varchar(20) NOT NULL,
  `user_id` varchar(30) NOT NULL,
  `vending_name` varchar(30) NOT NULL,
  `vending_description` varchar(255) NOT NULL DEFAULT '',
  `vending_full_size` tinyint(2) NOT NULL DEFAULT '10',
  `vending_in_date` datetime DEFAULT CURRENT_TIMESTAMP,
  `vending_update_date` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`serial_number`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `vendings_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`user_id`) ON DELETE CASCADE ON UPDATE CASCADE
);

-- 음료수 테이블 생성
CREATE TABLE `drinks` (
  `serial_number` varchar(20) NOT NULL,
  `drink_position` tinyint(4) NOT NULL,
  `drink_name` varchar(30) NOT NULL,
  `drink_price` int(2) NOT NULL,
  `drink_count` int(2) DEFAULT '10',
  `drink_max_count` int(2) DEFAULT '10',
  PRIMARY KEY (`serial_number`,`drink_position`),
  CONSTRAINT `drinks_ibfk_1` FOREIGN KEY (`serial_number`) REFERENCES `vendings` (`serial_number`) ON DELETE CASCADE ON UPDATE CASCADE
);

-- Hango 운영자 테이블 생성
CREATE TABLE `managers` (
  `manager_id` varchar(30) NOT NULL,
  `manager_name` varchar(30) NOT NULL,
  `manager_email` varchar(60) NOT NULL,
  `manager_passwd` varchar(128) NOT NULL,
  `manager_in_date` datetime DEFAULT CURRENT_TIMESTAMP,
  `manager_salt` varchar(128) NOT NULL,
  `manager_approbation_flag` int(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`manager_id`)
);

-- 판매 테이블 생성
CREATE TABLE `sales` (
  `sale_seq` int(4) NOT NULL AUTO_INCREMENT,
  `user_id` varchar(30) NOT NULL,
  `serial_number` varchar(20) NOT NULL,
  `drink_name` varchar(30) NOT NULL,
  `drink_price` int(2) NOT NULL,
  `sale_date` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`sale_seq`),
  KEY `serial_number` (`serial_number`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `sales_ibfk_1` FOREIGN KEY (`serial_number`) REFERENCES `vendings` (`serial_number`) ON UPDATE CASCADE,
  CONSTRAINT `sales_ibfk_2` FOREIGN KEY (`user_id`) REFERENCES `users` (`user_id`) ON UPDATE CASCADE
);

